import React from 'react';

import 'bootstrap/dist/css/bootstrap.min.css';
import Card from 'react-bootstrap/Card'
import Row from 'react-bootstrap/Row'
import Col from 'react-bootstrap/Col'

import me from './me.png';

function Main() {
    return (
        <Row>
            <Col md={{ span: 6, offset: 3 }}>
                <Card className="shadow" style={cardStyle}>
                    <Card.Body style={{fontSize:"x-large", fontWeight:"bold"}}>
                        <Row className="no-gutters">
                        <Col>Tired of boring quizzess all the <span style={{color:"#FFFFFF", backgroundColor: "#f26524", }}>time?</span>
                        <br></br>
                        Use <span style={{color:"#f26524"}}>Rhyme</span><span style={{color:"#faab53"}}>wit</span> so students learn through __________ .</Col>
                        <Col>
                        <Card.Img style={{height:"100px", width:"100px"}} src={me}>
                        </Card.Img>
                        </Col>
                        </Row>
                    </Card.Body>
                </Card>
            </Col>
        </Row>
    )
}

const cardStyle = {

}
export default Main;
